import './feed.css';
import Share from '../share/Share';
import Post from '../post/Post';
import { Posts } from '../../dummyData';

const Feed = () => {
  return (
    <div className="feed">
      <div className="feed-wrapper">
        <Share />
        <Post />
      </div>
    </div>
  );
};

export default Feed;
